contracts/KlineIntervalData.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.24;

// Điều chỉnh đường dẫn import nếu cần
import "../structs/DataTypes.sol";

contract KlineIntervalData {
    using KlineDataLib for KlineDataLib.CompactCandle;

    // --- Constants set by Factory & State Variables ---
    uint256 public immutable MAX_KLINE_HISTORY;
    KlineDataLib.Interval public immutable intervalType;
    string public symbol; // SỬA: Giờ là string public (không immutable)
    address public immutable factoryAddress;
    uint256 public immutable version;

    // --- State Variables ---
    KlineDataLib.CompactCandle[] public klines;
    uint256 public nextKlineIndex;
    uint256 public klineCount;

    address public oracleAddress;

    // --- Events ---
    event KlineAddedToIntervalData(
        KlineDataLib.Interval indexed interval,
        uint256 indexed version,
        string indexed symbol, // Thêm symbol vào event cho dễ theo dõi
        uint64 startTime,
        bool isUpdate
    );
    event OracleAddressUpdated(address indexed newOracleAddress);

    // --- Constructor ---
    constructor(
        string memory _symbol, // SỬA: Nhận string memory
        KlineDataLib.Interval _intervalType,
        uint256 _maxHistory,
        address _factoryAddress,
        address _initialOracleAddress,
        uint256 _version
    ) {
        symbol = _symbol; // Gán string
        intervalType = _intervalType;
        MAX_KLINE_HISTORY = _maxHistory;
        factoryAddress = _factoryAddress;
        oracleAddress = _initialOracleAddress;
        version = _version;
    }

    // --- Modifiers ---
    modifier onlyFactoryOrOracle() {
        require(msg.sender == factoryAddress || msg.sender == oracleAddress, "KID: Not factory or oracle");
        _;
    }

    // --- Functions ---
    function addOrUpdateKline(
        uint64 _startTime,
        uint64 _closeTime,
        uint256 _openPriceScaled,
        uint256 _highPriceScaled,
        uint256 _lowPriceScaled,
        uint256 _closePriceScaled,
        uint256 _volumeScaled,
        bool _isClosed
    ) external onlyFactoryOrOracle {
        KlineDataLib.CompactCandle memory newKline = KlineDataLib.CompactCandle({
            startTime: _startTime,
            closeTime: _closeTime,
            openPrice: _openPriceScaled,
            highPrice: _highPriceScaled,
            lowPrice: _lowPriceScaled,
            closePrice: _closePriceScaled,
            volume: _volumeScaled,
            isClosed: _isClosed
        });

        bool updatedExisting = false;
        if (klineCount > 0) {
            uint256 lastActualIndex;
            if (nextKlineIndex == 0) {
                lastActualIndex = (klineCount == MAX_KLINE_HISTORY) ? MAX_KLINE_HISTORY - 1 : klineCount - 1;
            } else {
                lastActualIndex = nextKlineIndex - 1;
            }

            if (klines[lastActualIndex].startTime == _startTime && !klines[lastActualIndex].isClosed) {
                klines[lastActualIndex] = newKline;
                updatedExisting = true;
            }
        }

        if (!updatedExisting) {
            if (klines.length < MAX_KLINE_HISTORY) {
                klines.push(newKline);
                nextKlineIndex = klines.length; // Không cần modulo ở đây nếu chưa đầy
                klineCount = klines.length;
            } else { // Buffer đầy
                klines[nextKlineIndex] = newKline;
                nextKlineIndex = (nextKlineIndex + 1) % MAX_KLINE_HISTORY;
                // klineCount vẫn là MAX_KLINE_HISTORY
            }
        }
        emit KlineAddedToIntervalData(intervalType, version, symbol, _startTime, updatedExisting);
    }

    function getKlines(uint256 _count) external view returns (KlineDataLib.CompactCandle[] memory) {
        if (klineCount == 0) {
            return new KlineDataLib.CompactCandle[](0);
        }
        uint256 numToReturn = _count > klineCount ? klineCount : _count;
        KlineDataLib.CompactCandle[] memory result = new KlineDataLib.CompactCandle[](numToReturn);

        if (klineCount < MAX_KLINE_HISTORY) { // Buffer chưa đầy
            uint256 readStartIndex = (klineCount > numToReturn) ? (klineCount - numToReturn) : 0;
            for (uint i = 0; i < numToReturn; i++) {
                result[i] = klines[readStartIndex + i];
            }
        } else { // Buffer đã đầy
            uint256 startIdx = nextKlineIndex;
            if (numToReturn < MAX_KLINE_HISTORY) {
                 startIdx = (nextKlineIndex + MAX_KLINE_HISTORY - numToReturn) % MAX_KLINE_HISTORY;
            }
            for (uint i = 0; i < numToReturn; i++) {
                result[i] = klines[(startIdx + i) % MAX_KLINE_HISTORY];
            }
        }
        return result;
    }

    function getAllKlinesInThisVersion() external view returns (KlineDataLib.CompactCandle[] memory) {
        return this.getKlines(klineCount);
    }

    function setOracle(address _newOracleAddress) external {
        require(msg.sender == factoryAddress, "KID: Only factory can set oracle");
        require(_newOracleAddress != address(0), "KID: Invalid oracle address");
        oracleAddress = _newOracleAddress;
        emit OracleAddressUpdated(_newOracleAddress);
    }

    // SỬA: Trả về symbol là string memory
    function getInfo() external view returns (string memory workerSymbol, KlineDataLib.Interval workerInterval, uint256 workerVersion, uint256 workerKlineCount, uint256 workerMaxKlines) {
        return (symbol, intervalType, version, klineCount, MAX_KLINE_HISTORY);
    }
}

structs/DataTypes.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.24;

library KlineDataLib {
    struct CompactCandle {
        uint64 startTime;
        uint64 closeTime;
        uint256 openPrice;
        uint256 highPrice;
        uint256 lowPrice;
        uint256 closePrice;
        uint256 volume;
        bool isClosed;
    }

    enum Interval {
        MIN_1, MIN_3, MIN_5, MIN_15, MIN_30,
        HOUR_1, HOUR_2, HOUR_4, HOUR_6, HOUR_8, HOUR_12,
        DAY_1, DAY_3,
        WEEK_1,
        MONTH_1,
        COUNT // Để biết số lượng interval
    }

    // Có thể thêm các hằng số precision ở đây nếu muốn
    // uint256 public constant PRICE_PRECISION_DECIMALS = 8;
    // uint256 public constant VOLUME_PRECISION_DECIMALS = 4;
}

